package main

const (
	hashTest      = "0267b"
	hashDelegator = "012453142627192818101141829a2a1928181011102db1367b"
	hashVesting   = ""
)

func detectKind(hashCode string) string {
	switch hashCode {
	case hashTest:
		return "test_contract"
	case hashDelegator:
		return "delegator_contract"
	case hashVesting:
		return "vesting_contract"
	default:
		return "smart_contract"
	}
}
